    return (
        <Backdrop>
            <div
                className={classes.OpenCard}>
                {/* <div 
                className={classes.Placeholder}> */}
                <div
                    className={classes.MemeContainer}>
                    <img src={meme} alt="Meme"/>
                </div>
                <div 
                    className={classes.ButtonContainer}>
                    X
                </div>
                {/* </div> */}
            </div>
        </Backdrop>
    );
}
